syntax = "proto3";
package DumpProtos;

//----- Begin auth -----

// ref: Com.Nianticproject.Platform.Auth.BackgroundToken
message BackgroundToken {
	bytes token = 1;
	int64 expiration_time = 2;
	bytes iv = 3;
}

// ref: Com.Nianticproject.Platform.Auth.RegisterBackgroundDeviceActionProto
message RegisterBackgroundDeviceActionProto {
	string device_type = 1;
	string device_id = 2;
}

// ref: Com.Nianticproject.Platform.Auth.RegisterBackgroundDeviceResponseProto
message RegisterBackgroundDeviceResponseProto {
	// ref: Com.Nianticproject.Platform.Auth.RegisterBackgroundDeviceResponseProto/Types/Status
	enum Status {
		UNSET = 0;
		SUCCESS = 1;
		ERROR = 2;
	}

	BackgroundToken token = 1;
}

//----- End auth -----
//------------------------------
//----- Begin developertoken -----

// ref: Niantic.Platform.Auth.Plugins.DeveloperToken.DeveloperToken
message DeveloperToken {
	string id_token = 1;
	string owner_email = 2;
}

//----- End developertoken -----
//------------------------------
//----- Begin gamemaster -----

// ref: Niantic.Platform.GameMaster.ClientGameMasterTemplateProto
message ClientGameMasterTemplateProto {
	string template_id = 1;
	bytes data = 2;
}

// ref: Niantic.Platform.GameMaster.DownloadGmTemplatesRequestProto
message DownloadGmTemplatesRequestProto {
	int64 basis_batch_id = 1;
	int64 batch_id = 2;
	int32 page_offset = 3;
	bool apply_experiments = 4;
	repeated int32 basis_experiment_id = 5;
	repeated int32 experiment_id = 6;
}

// ref: Niantic.Platform.GameMaster.DownloadGmTemplatesResponseProto
message DownloadGmTemplatesResponseProto {
	// ref: Niantic.Platform.GameMaster.DownloadGmTemplatesResponseProto/Types/Result
	enum Result {
		UNSET = 0;
		COMPLETE = 1;
		MORE_RESULTS = 2;
		BATCH_ID_NOT_LIVE = 3;
		INVALID_BASIS_BATCH_ID = 4;
		WRONG_EXPERIMENTS = 5;
	}

	repeated ClientGameMasterTemplateProto template = 1;
	repeated string deleted_template = 2;
	uint64 batch_id = 3;
	int32 page_offset = 4;
	repeated int32 experiment_id = 5;
}

//----- End gamemaster -----
//------------------------------
//----- Begin iap -----

// ref: Nia.Iap.SetInGameCurrencyExchangeRateOutProto
message SetInGameCurrencyExchangeRateOutProto {
	// ref: Nia.Iap.SetInGameCurrencyExchangeRateOutProto/Types/Status
	enum Status {
		UNSET = 0;
		SUCCESS = 1;
		FAILURE = 2;
	}

}

// ref: Nia.Iap.SetInGameCurrencyExchangeRateProto
message SetInGameCurrencyExchangeRateProto {
	string in_game_currency = 1;
	string fiat_currency = 2;
	int64 fiat_currency_cost_e6_per_in_game_unit = 3;
}

//----- End iap -----
//------------------------------
//----- Begin inventory -----

// ref: Niantic.Platform.Inventory.InventoryDeltaProto
message InventoryDeltaProto {
	int64 original_timestamp = 1;
	int64 new_timestamp = 2;
	repeated InventoryItemProto inventory_item = 3;
}

// ref: Niantic.Platform.Inventory.InventoryItemProto
message InventoryItemProto {
	// ref: Niantic.Platform.Inventory.InventoryItemProto/InventoryItemOneofCase
	//oneof InventoryItem {
		//none = 0;
		//deleted_item_key = 2;
		//item = 3;
	//}

	int64 modified_timestamp = 1;
	bytes deleted_item_key = 2;
	bytes item = 3;
}

//----- End inventory -----
//------------------------------
//----- Begin platform -----

// ref: Com.Nianticproject.Platform.ProxyRequestProto
message ProxyRequestProto {
	uint32 action = 1;
	string host = 2;
	bytes payload = 3;
}

// ref: Com.Nianticproject.Platform.ProxyResponseProto
message ProxyResponseProto {
	// ref: Com.Nianticproject.Platform.ProxyResponseProto/Types/Status
	enum Status {
		UNSET = 0;
		COMPLETED = 1;
		COMPLETED_AND_REASSIGNED = 2;
		ACTION_NOT_FOUND = 3;
		ASSIGNMENT_ERROR = 4;
		PROXY_UNAUTHORIZED_ERROR = 5;
		INTERNAL_ERROR = 6;
		BAD_REQUEST = 7;
		ACCESS_DENIED = 8;
		TIMEOUT_ERROR = 9;
		RATE_LIMITED = 10;
	}

	string assigned_host = 1;
	bytes payload = 2;
}

//----- End platform -----
